from sympy import isprime
def ok(n):
    if n%10 not in {1, 3, 7, 9}: return False
    s = str(n)
    return any(isprime(int(s[:i]+str(2*int(s[i:j]))+s[j:])) for i in range(len(s)) for j in range(i+1, len(s)+1) if s[i]!='0')
